        set static::MS_OFBA_AUTH_DIALOG_SZ "800x600"
        set static::MS_OFBA_AUTH_SUCCESS_BODY "<html><head><title>User Authenticated</title></head><body><b>Successful OFBA authentication</b></body></html>"
